import Navbar from "../navbar/Navbar";
import '../navbar/Navbar.css'
import Card1 from "./card1/Card1";
import '../dashboard/card1/Card1.css';
import Card2 from "./card2/Card2";
import '../dashboard/card2/Card2.css';
import Activity from "./activity/Activity";
import '../dashboard/activity/Activity.css';
import Announcement from "./announcement/Announcement";
import '../dashboard/announcement/Announcement.css';

function Dashboard() {

  

  return (

    <div className="dashboard">
        <div className="horizonteldiv"></div>
        <div className="background">
          <Navbar/>
          <Dashboard1/>
          
        </div>
    </div>
  )  
}

function Dashboard1() {
  const details = [{
    title : "Total Employees",
    empnum:"216",
    mennum:"120",
    womennum:"96",
    img: "../images/graph1.png",
  },
  {
    title : "Total Employees",
    empnum:"216",
    mennum:"120",
    womennum:"96",
    img: "../images/graph1.png",
  },
  {
    detail: "Meeting HR Department",
    time:"Yesterday, 12:30 PM" ,
    img: "./images/pin.png",
  },
  {
    detail: "IT Department need two more talents for UX/UI",
    time:"Yesterday, 09:15 AM" ,
    img: "./images/pin.png",
  },
  {
    detail: "Outing schedule for every departement",
    time:"5 Minutes ago" ,
    img: "./images/pinned.png",
  },
  {
    detail: "Meeting HR Department",
    time:"Yesterday, 12:30 PM" ,
    img: "./images/pin.png",
  },
  {
    detail: "IT Department need two more talents for UX/UI",
    time:"Yesterday, 09:15 AM" ,
    img: "./images/pin.png",
  },];

  return(
    <div  className='dash-content'>
        <div className="leftdiv">
          <div className="jobscontain">
          {details.map((i, index) => {
                return (
                    <div key={index}>
                        <Card1 title={i.detail} empnum={i.time}  />
                    </div>
                )
            })}
            <Card1/>
            <Card1/>
            <Card1/>
          </div>
          <div className="graphcontain">
            {details.map((i, index) => {
                  return (
                      <div key={index}>
                          <Card1 title={i.title} empnum={i.time}  mennum={i.mennum} womennum={i.womennum} img={i.img} />
                      </div>
                  )
              })}
            <Card2/>
            <Card2/>
          </div>
          <Announcement/>
        </div>
        <Activity/>
    </div>
  )
}










export default Dashboard;
